Categories Feature, Massage, Prebooks

Cast Remy LaCroix, Jessica Drake, Vicki Chase, Katrina Jade, Lezley, Erik Everhard, Brad Armstrong, Tommy Gunn, Barrett Blade

Join Wicked Contract star Jessica Drake and her band of Bad Ass Bitches in this oiled up adventure. Vickie Chase, Lezley Zen, Remy LaCroix, and Katrina Jade all went to school to become massage therapists, but quickly learned it just didn't pay the bills. Now they work for Jessica at &quot;Magic Hands Massage&quot;, a high end outcall service with a twist. At Magic Hands, these naughty hotties have more on their minds than just giving their customers a &quot;Happy Ending&quot;. They target rich, married men who have lots to lose, and when the time is right, they snatch their money, jewelry, and anything else they can get their hands on. When the sex is over, they'll be feeling oiled up, rubbed down, but ripped off!
